                img: 'geroin.webp',
                desc: 'Lorem ipsum dolor sit amet.',
                category: 'narcos',
                price: '500.54'
            },
            ]
        }
    }
    render() {
        return (  
            <div>
                <Header />
                <div className="wrapper">
                    <Items items={this.state.items} />
                </div>
                <Footer />
            </div>
        );
    }
}

export default App;
